        sumY = [[i1+j1 for i1, j1 in zip(i,j)] for i, j in zip(weightedTurnoverY, sumY)]

        pResult = [[sum(a * b for a, b in zip(A_row, B_col))
                        for B_col in zip(*sumY)]
                                for A_row in xT]

